description:
This video has been designed to inform those who work within the My Aged Care assessor portal.
How to: 
• view and assign review requests; 
• re-assign a review request; 
• cancel a review request; 
• view the history of completed and cancelled reviews. 

For additional support you can refer to the resources below available on the Department’s ACAT information pack – Quick Reference Guides and Quick Tips page: 
• Quick Reference Guide 3 – Managing referrals for assessment and support plan reviews (ACAT)

This video provides an overview of how to configure Commonwealth Home Support Programme (CHSP) services in the My Aged Care Provider Portal. The video guides you through how to:
• Add a new CHSP service item;
• Update your service status and availability information; 
• Update your service delivery area; 
• Promote the unique aspects of the services you provide; 
• Update your service subtype information to provide additional detail about the services you provide.

The information you provide will be searchable through the public My Aged Care Service Finder (https://www.myagedcare.gov.au/service-finder/help-at-home?tab=help-at-home)and), under the ‘Help at Home’ tab. 

For additional support you can refer to the resources below available on the Department’s Information for Service Providers page (https://agedcare.health.gov.au/our-responsibilities/ageing-and-aged-care/programs-services/my-aged-care/information-for-service-providers): 
• Quick Reference Guide – Create service delivery outlets and service information using the provider portal
• My Aged Care Provider Portal User Guide: Part One – Administrator functions

This video provides an overview of how to configure Residential Aged Care services in the My Aged Care Provider Portal. The video guides you through how to:
• Add a new residential aged care service item;
• Update your service status and availability information; 
• Update your service delivery area; 
• Promote the unique aspects of the services you provide; 
• Update your service subtype information to provide additional detail about the services you provide including the types of rooms you offer.

The information you provide will be searchable through the public My Aged Care Service Finder (https://www.myagedcare.gov.au/service-finder/help-at-home?tab=help-at-home)and), under the ‘Aged Care Homes’ tab. 

For additional support you can refer to the resources below available on the Department’s Information for Service Providers page (https://agedcare.health.gov.au/our-responsibilities/ageing-and-aged-care/programs-services/my-aged-care/information-for-service-providers): 
• Quick Reference Guide – Create service delivery outlets and service information using the provider portal
• My Aged Care Provider Portal User Guide: Part One – Administrator functions

This video provides an overview of how navigate and view information in the client record in the My Aged Care provider portal including how to:
• Locate a client who has been referred or accepted to service;
• View detailed client information contained in the client record tab;
• Navigate between the referrals, plans, attachments, approvals for service, interactions and notes tabs;
• View tasks and notifications that are associated to clients that your outlet provides services for.

For additional support you can refer to the resources below available on the Department’s Information for Service Providers page (https://agedcare.health.gov.au/our-responsibilities/ageing-and-aged-care/programs-services/my-aged-care/information-for-service-providers) 
• Quick Reference Guide – Navigating and viewing information in the client record
• My Aged Care Provider Portal User Guide: Part Two – Team Leader and Staff Member functions

This video provides an overview of how to manage a waitlist t in the My Aged Care Provider Portal. The video guides you through how to:
• Establish a waitlist in the provider portal;
• Add a client to your waitlist;
• Manage your waitlist;
• Accept a client into service from your waitlist. 

For additional support you can refer to the resources below available on the Department’s Information for Service Providers page (https://agedcare.health.gov.au/our-responsibilities/ageing-and-aged-care/programs-services/my-aged-care/information-for-service-providers): 
• My Aged Care Provider Portal User Guide: Part One – Administrator functions
• Quick Reference Guide – Manage referrals for service through the My Aged Care Provider Portal
• My Aged Care Provider Portal User Guide: Part Two – Team Leader and Staff Member Functions

This video provides an overview of how to use the Home Care Package service finder to find a provider that best meets your needs. The video guides you through:
• how to do a basic search based on your location, or the provider’s name (if known);
• how to do an advanced search to narrow your results to providers who offer specialised services, or cater to specific cultural, religious and language specialisations; 
• how to interpret the information from your search result; and 
• how to create a short-list of your preferred providers.
